import React, { useState } from 'react';

//import Header from './Header';

function App() {
  const [counter, setCounter] = useState('teste0');
  let counterx = counter
  let teste = function () {
    if (counterx == 'teste0') {
      counterx = 'teste1';
    } else {
      counterx = 'teste0'
    }
    return counterx;
  }

  function incrementCounter() {
    setCounter(teste);
  }
  return (
    <>
      <h1>Contador: {counter}</h1>
      <button onClick={incrementCounter}>Incrementar</button>
    </>
  );

}

export default App;
